import {lazy} from 'react';

const Home = lazy(() => import('./Home'));
const Explore = lazy(() => import('./Explore'));
const Bookmark = lazy(() => import('./Bookmark'));

export default [
    {
        path: '/home',
        exact: true,
        public: true,
        component: {Home}
    },
    {
        path: '/explore',
        exact: true,
        public: true,
        component: {Explore}
    },
    {
        path: '/bookmark',
        exact: true,
        public: true,
        component: {Bookmark}
    }
]
